import React from 'react';

const Scroll = (props) => {
	return (
		<div style={{ overflow: 'scroll', 
						border: '5px solid gray',
						height: '800px',
						margin: '10px'  }}>
			{props.children}
		</div>
		);
};

export default Scroll;
